import styled from 'styled-components';

export const Container = styled.div`
	margin: auto;
	width: 400px;
	height: 500px;
	background: #f1f1f1;
	padding: 10px;
	border-radius: 8px;
	box-shadow: 10px 10px 4px #eaeaea;
	text-align: center;
`;

export const Card = styled.div`
	margin: auto;
	padding: 10px;
`;
